import React from "react";

const LongCard = (props) => {
  return (
    <div class="block rounded-lg w-max m-5 bg-white text-surface shadow-secondary-1 dark:bg-surface-dark dark:text-white">
      <div class="border-b-2 border-neutral-100 px-6 py-3 dark:border-white/10">
        {props.title}
      </div>
      <div class="p-6">
        <div>
          <p class="text-xl">{props.description}</p>
        </div>
      </div>
    </div>
  );
};

export default LongCard;
